            description: '',
            mimeType: 'text/html',
            category: 'Resource',
            content:
              '<p>Before going to the lab you need to know that:</p><p>- each element in the Periodic Table consists of its own characteristic atoms <br></p><p>- atoms have a nucleus surrounded by electrons;</p><p>- the nucleus consists of protons and neutrons;</p><p>- protons have a positive charge;</p><p>- electrons have a negative charge;</p><p>- neutrons have no charge;</p><p>- protons and neutrons have a mass of 1, electrons have a negligible mass;</p><p>- the mass number is used to indicate the total mass of an atom. </p><p><br></p><p>The SI unit of charge is <strong>elementary charge</strong> <strong>(<em>e</em>)</strong>, with a very small value in C (Coulomb).</p><p>The SI for mass is in <strong>atomic mass units (u)</strong>, with a very small value in kg. </p><p><br></p><p>What is the value for <em>e </em>in C; and what is the value for u in kg<em>?</em><br> </p>',
